import express from "express";
import getTokenApi from "../utils/getTokenApi.js";
import axios from "axios";

const router = express.Router();

router.post("/cargarProceso", async function (req, res, next) {
  let {
    representante_legal,
    cedula_representante_legal,
    correo,
    numero_celular,
  } = req.body;

  console.log("Body: ", req.body);

  if (!correo && !numero_celular) {
    return res
      .status(400)
      .json({ error: "Correo o celular deben estar presentes" });
  }

  // Eliminar el indicativo "+57" del n√∫mero de celular si existe

  if (typeof numero_celular === "string" && numero_celular.startsWith("+57")) {
    numero_celular = numero_celular.substring(3); // Elimina los primeros 3 caracteres
  }

  console.log(
    "Variables: ",
    representante_legal,
    cedula_representante_legal,
    correo,
    numero_celular
  );

  try {
    const jsonBody = {
      sendCompletionNotification: true,
      emailForNotification: "juan.munoz@affi.net",
      processes: [
        {
          enterpriseId: "9000533702",
          senderEmail: "juan.munoz@affi.net",
          senderIdentification: "1109184891",
          signers: [
            {
              name: representante_legal,
              documentType: "CC",
              identification: cedula_representante_legal,
              email: correo,
              phone: numero_celular,
              role: "APPROVER",
              authMethods: ["OTP"],
            },
            5,
          ],
          documents: [
            {
              content:
                "",
              fileName: "contrato fianza.pdf",
            },
          ],
          subject: "Asunto-prueba de api",
          message: "Buen d√≠a, remito prueba de firma.",
          order: "true",
          expirationDate: "",
        },
      ],
    };

    // Esperar el token de la funci√≥n as√≠ncrona
    const token = await getTokenApi();

    // Verificar si el token fue obtenido exitosamente
    if (!token || typeof token !== "string") {
      throw new Error("No se pudo obtener un token v√°lido.");
    }

    const processResponse = await axios.post(
      "https://qa-mpl.autenticsign.com/v3/signing-process/",
      jsonBody,
      {
        headers: {
          Authorization: `Bearer ${token}`,
        },
      }
    );

    res.status(200).json({
      massiveProcessingId: processResponse.data.body.massiveProcessingId,
    });
  } catch (error) {
    console.error("Error al cargar el proceso:", error);
    res.status(500).json({ error: "No se pudo cargar el proceso" });
  }
});

export default router;
